window.bookSummaryJSON = "<p>For the first time - in one Audible-exclusive collection - it's 13 stories of Jane Yellowrock, the shape-shifting skinwalker and vampire hunter for hire whose business card reads, \"Have Stakes - Will Travel\". Jane carries inside her the soul of her Beast, the mountain lion's soul which merged with hers when she accidently performed black magic as a child. Now, she and her Beast stalk the dark streets of New Orleans, bringing rogue vampires true death. </p> <p>In <i>Cat o' Nine Tales</i>, you'll discover how Jane turned into a big cat for the first time; how she and Molly became friends; how Rick LaFleur got his tattoos. You'll go along on some of Jane's early vamp hunts. You'll even hear two short tales through Bruiser's eyes. </p> <p>Once you experience these stories set in the fantastic world of this <i>New York Times</i> best-selling series, you'll surely agree with Kim Harrison that Jane Yellowrock is \"smart, sexy and ruthless\".</p> <p>The stories included in <i>Cat o' Nine Tales</i> are:</p> <p> \"WeSa and the Lumber King\" <br> \"The Early Years\"<br> \"Cat Tats\"<br>\"Kits\"<br>\"Haints\"<br> \"Signatures of the Dead\"<br>\"First Sight\"<br>\"Blood, Fangs and Going Furry\"<br> \"Dance Master\"<br>\"Cajun With Fangs\"<br> \"Golden Delicious\"<br>\"Beneath a Bloody Moon\"<br> \"Black Water\"</p>"; 
